import classes from "./AvailableMeals.module.css";
import Card from "../../UI/Card";
import MealItem from "./MealItem";

const AvailableMeals = (props) => {
  return (
    <section className={classes.meal}>
      <Card>
        <ul>
          <MealItem />
        </ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
